    super(props);

    this.state = {};
  }

  render() {
    return (
      <div>
        <header>
          <nav className="navbar navbar-expand-md navbar-blue bg-red">
            <div>
              <a className="navbar-brand">gestion des etudiants emsi</a>
            </div>
          </nav>
        </header>
      </div>
    );
  }
}

export default HeaderComponent;
